import React from 'react';
import { Link } from "react-router-dom";
import '../style/Accueil.css';
import { motion } from 'framer-motion';
import younesImg from '../images/younes.png';
import maryamImg from '../images/maryam.png';
import wiamImg from '../images/wiam.png';
import ammarImg from '../images/ammar.png';
import hindImg from '../images/hind.png';
import abdelImg from '../images/abdelwadoud.png';
import basmaImg from '../images/basma.png';
import imaneImg from '../images/imane.png';

const members = [
  { name: "Younes TAOUMI", role: "Team Leader", image: younesImg },
  { name: "Maryam BADRI", role: "Vice Team Leader", image: maryamImg },
  { name: "Wiam ABOUTARA BELRHITI", role: "Vice President Project", image: wiamImg },
  { name: "Ammar MASSAOUDI", role: "Communication Manager", image: ammarImg },
  { name: "Hind ZAKY", role: "Human Ressources Manager", image: hindImg },
  { name: "Abdelwadoud EL BAROUJI", role: "Treasurer", image: abdelImg },
  { name: "Basma JAWHAR", role: "Event Manager", image: basmaImg },
  { name: "Imane OUAZZANI CHAHDI", role: "Head of partnerships", image: imaneImg },
];

const projects = [
  {
    name: "Biogazify",
    description: "Convertit les déchets organiques en biogaz pour la cuisine.",
    link: null
  },
  {
    name: "Bistrokabb",
    description: "Valorisation des câpres marocaines, en soutenant les femmes et la cuisine artisanale.",
    link: "https://www.instagram.com/bistro_kabb/?utm_source=ig_web_button_share_sheet"
  },
  {
    name: "Bottle 3D",
    description: "Recycle les bouteilles plastiques en filaments pour imprimantes 3D.",
    link: null
  },
  {
    name: "Educlass Mingle",
    description: "Plateforme éducative combinant réseaux sociaux et études.",
    link: "https://www.instagram.com/educlassmingle?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Enbo",
    description: "Boîtes écologiques à 3 couches fabriquées à partir de matériaux recyclés.",
    link: null
  },
  {
    name: "Potrinov",
    description: "Réinvente la poterie marocaine en alliant tradition et digital.",
    link: "https://www.instagram.com/potrinov.ma?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Reskin",
    description: "Transforme les déchets alimentaires en cosmétiques durables et éco-responsables.",
    link: "https://www.instagram.com/reskincosmetique?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Sitauti",
    description: "Plateforme interactive de soutien pour l’autisme.",
    link: "https://www.instagram.com/sit.auti?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Uniride",
    description: "Appli mobile de covoiturage étudiant, pour une mobilité durable.",
    link: "https://www.instagram.com/uniride_etu?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw=="
  },
  {
    name: "Voltainos",
    description: "Solution énergétique durable combinant éolien et piézoélectrique.",
    link: null
  }
];



const Accueil = () => {
  return (
    <>
      {/* Vidéo en fond */}
      <div>
        <video autoPlay loop muted playsInline className="background-video">
          <source src={require('../images/Enactus.mp4')} type="video/mp4" />
        </video>

        {/* Section équipe */}
        <section className="equipe-section">
          <h2 className="equipe-titre">Notre Équipe</h2>
          <div className="equipe-membres">
            {members.map((member, index) => (
              <motion.div
                key={index}
                className="membre-carte"
                whileHover={{ scale: 1.05 }}
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ duration: 0.5, delay: index * 0.2 }}
              >
                <img src={member.image} alt={member.name} className="membre-photo" />
                <h3 className="membre-nom">{member.name}</h3>
                <p className="membre-role">{member.role}</p>
              </motion.div>
            ))}
          </div>
        </section>

        {/* Section À propos */}
        <section className="about-section">
  <div className="about-container">
    <motion.h2 
      className="about-title"
      initial={{ opacity: 0, y: -30 }} 
      whileInView={{ opacity: 1, y: 0 }} 
      transition={{ duration: 0.8 }}
    >
      À propos de nous
    </motion.h2>

    <motion.p 
      className="about-description"
      initial={{ opacity: 0 }} 
      whileInView={{ opacity: 1 }} 
      transition={{ delay: 0.3 }}
    >
      <strong>Depuis 2014</strong>, Enactus FSBM rassemble des étudiants passionnés par l’entrepreneuriat social. 
      Ensemble, nous avons réalisé <strong>40+</strong> projets à fort impact, mobilisé <strong>1000+</strong> étudiants, 
      et transformé la vie de <strong>500+</strong> bénéficiaires.
    </motion.p>

    <div className="about-grid">
      <motion.div 
        className="about-card"
        whileHover={{ scale: 1.05 }}
      >
        <h3>Top 12</h3>
        <p>Classement national 2023-2024</p>
      </motion.div>

      <motion.div 
        className="about-card"
        whileHover={{ scale: 1.05 }}
      >
        <h3>13</h3>
        <p>Objectifs de développement durable touchés</p>
      </motion.div>

      <motion.div 
        className="about-card"
        whileHover={{ scale: 1.05 }}
      >
        <h3>3000h+</h3>
        <p>De formation et d’accompagnement</p>
      </motion.div>
    </div>

    <motion.p 
      className="about-formula"
      initial={{ opacity: 0 }} 
      whileInView={{ opacity: 1 }} 
      transition={{ delay: 0.6 }}
    >
      Enactus = <span>Entrepreneuriat</span> + <span>Action</span> + <span>Us</span>
    </motion.p>
  </div>
</section>

      </div>
    </>
  );
};

export default Accueil;
